import React from 'react';
import { connect } from "react-redux";
import * as actionCreator from '../store/actions/itineraryActions.ks';

class CityPage extends React.Component {
    constructor(props) {
        super(props);
    }

    componentDidMount() {
        this.props.getCity();
    }

    render() {
        return (
            <div>
                <p className="cityName">  </p>
                {/* <img className="cityImage" src={this.image} alt="City" /> */}
                <div className="content">
                    <p className="cityHeadline">Available MYtineries</p>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {cities: state.cities, city: state.city, citiesIsLoading: state.citiesIsLoading};
}

function mapDispatchToProps(dispatch) {
    return {
        getCity: (city) => dispatch(actionCreator.fetch()),
    }
}

export default connect(mapStateToProps, mapDispatchToProps) (CitiesPage);
